def minPath(grid, k):
    n = len(grid)
    m = len(grid[0])

    # Find the starting position of the minimum value in the grid
    min_val = float('inf')
    start_i, start_j = 0, 0
    for i in range(n):
        for j in range(m):
            if grid[i][j] < min_val:
                min_val = grid[i][j]
                start_i, start_j = i, j

    # Define the directions for movement (up, down, left, right)
    directions = [(-1, 0), (1, 0), (0, -1), (0, 1)]

    # Function to check if a cell is within the grid
    def is_valid(i, j):
        return 0 <= i < n and 0 <= j < m

    # Function to find the minimum path using DFS
    def dfs(i, j, path, visited):
        if len(path) == k:
            return path
        for di, dj in directions:
            ni, nj = i + di, j + dj
            if is_valid(ni, nj) and (ni, nj) not in visited:
                visited.add((ni, nj))
                result = dfs(ni, nj, path + [grid[ni][nj]], visited)
                if result:
                    return result
                visited.remove((ni, nj))

    # Start the DFS from the minimum value position
    visited = {(start_i, start_j)}
    return dfs(start_i, start_j, [min_val], visited)

